TalComponent::~TalComponent()
{
    //ImageCache::release (internalCachedBackgroundImage);
    getFilter()->removeChangeListener (this);
    deleteAllChildren();
}

FilmStripKnob* TalComponent::addNormalKnob(int x, int y, TalCore* const ownerFilter, const Image knobImage, int numOfFrames, int parameter)
{
	FilmStripKnob *filmStripKnob;
	addAndMakeVisible(filmStripKnob = new FilmStripKnob(knobImage,
									 numOfFrames,
									 false));
    filmStripKnob->setBounds(x, y, knobImage.getWidth(), knobImage.getHeight() / numOfFrames);
	filmStripKnob->setValue(ownerFilter->getParameter(parameter), false);
	filmStripKnob->addListener (this);
	return filmStripKnob;
}

ImageToggleButton* TalComponent::addNormalButton(int x, int y, TalCore* const ownerFilter, const Image buttonImage, bool isKickButton, int parameter)
{
	ImageToggleButton *imageToggleButton;
	addAndMakeVisible(imageToggleButton = new ImageToggleButton("Toggle Button", buttonImage, false, isKickButton));
    imageToggleButton->setBounds(x, y, buttonImage.getWidth(), buttonImage.getHeight() / 2);
	imageToggleButton->setToggleState(ownerFilter->getParameter(parameter) > 0.0f, false);
	imageToggleButton->addButtonListener(this);
	return imageToggleButton;
}

ImageSlider* TalComponent::addSlider(int x, int y, TalCore* const ownerFilter, const Image sliderImage, int height, int parameter)
{
	ImageSlider *imageSlider;
	addAndMakeVisible(imageSlider = new ImageSlider(sliderImage, height));
	imageSlider->setBounds(x, y, /*sliderImage->getWidth()*/ 40, height + sliderImage.getHeight());
	imageSlider->setValue(ownerFilter->getParameter(parameter), false);
	imageSlider->addListener (this);
	return imageSlider;
}

ComboBox* TalComponent::addComboBox(int x, int y, int width, TalCore* const ownerFilter, int parameter)
{
	ComboBox *comboBox;
	addAndMakeVisible(comboBox = new ComboBox(T("ComboBox")));
	comboBox->setBounds(x, y, width, 20);
	comboBox->setColour(ComboBox::backgroundColourId, Colour::greyLevel(0.2f));
	comboBox->setColour(ComboBox::textColourId, Colour::greyLevel(1.0f));	
	comboBox->setColour(ComboBox::buttonColourId, Colour((juce::uint8)8, (juce::uint8)11, (juce::uint8)58, 0.0f));
	comboBox->setColour(ComboBox::arrowColourId, Colour((juce::uint8)8, (juce::uint8)11, (juce::uint8)58, 0.0f));
    comboBox->setSelectedId((int)ownerFilter->getParameter(parameter), true);
    comboBox->addListener (this);
	return comboBox;
}

//==============================================================================
void TalComponent::paint (Graphics& g)
{
    // just clear the window
    g.fillAll (Colour::greyLevel (0.9f));

    const Image image = ImageCache::getFromMemory(bmp00128_png, bmp00128_pngSize);
    g.drawImage (image,
                 0, 0, image.getWidth(), image.getHeight(),
                 0, 0, image.getWidth(), image.getHeight());
}

//==============================================================================
void TalComponent::changeListenerCallback (void* source)
{
    // this is the filter telling us that it's changed, so we'll update our
    // display of the time, midi message, etc.
    updateParametersFromFilter();
}

