void TalComponent::updateInfo(Slider* caller)
{
    // FIXME: Refactor
    TalCore* const filter = getFilter();
    if (caller == osc1TuneKnob || caller == osc2TuneKnob)
    {
        infoText->setText(juce::String(audioUtils.getOscTuneValue((float)caller->getValue()), 0), false);
    }
    else if (caller == osc1FineTuneKnob || caller == osc2FineTuneKnob || caller == oscMasterTuneKnob)
    {
        infoText->setText(juce::String(audioUtils.getOscFineTuneValue((float)caller->getValue()), 4), false);
    }
    else if (caller == filterContourKnob)
    {
        infoText->setText(juce::String(audioUtils.getLogScaledLinearValueCentered((float)caller->getValue()), 2), false);
    }
    else if (caller == lfo1AmountKnob || caller == lfo2AmountKnob || caller == freeAdAmountKnob)
    {
        infoText->setText(juce::String(audioUtils.getLogScaledValueCentered((float)caller->getValue()), 4), false);
    }
    else if (caller == osc1VolumeKnob || caller == osc2VolumeKnob || caller == osc3VolumeKnob)
    {
        infoText->setText(juce::String(audioUtils.getLogScaledValueInDecibel((float)caller->getValue(), 1) , 2) + T(" dB"), false);
    }
    else if (caller == volumeKnob)
    {
        infoText->setText(juce::String(audioUtils.getLogScaledValueInDecibel((float)caller->getValue(), 2) , 2) + T(" dB"), false);
    }
    else if (caller == pitchwheelPitchKnob)
    {
        infoText->setText(juce::String(12.0f * (float)caller->getValue() , 2), false);
    }
    else if (caller == transposeKnob)
    {
        infoText->setText(juce::String(audioUtils.getTranspose((float)caller->getValue()), 2), false);
    }
    else if (caller == osc1PwKnob)
    {
        infoText->setText(juce::String(audioUtils.getLogScaledLinearValueCentered((float)caller->getValue()), 2), false);
    }
    else if (caller == lfo1RateKnob || caller == lfo2RateKnob)
    {
        float isSync = false;
        if (filter->getParameter(LFO1SYNC) > 0.0f && caller == lfo1RateKnob
            || filter->getParameter(LFO2SYNC) > 0.0f && caller == lfo2RateKnob)
        {
            isSync = true;
        }
        if (isSync)
        {
            float value = (float)caller->getValue();
            char *text = audioUtils.getSyncedRateAndGetText(&value, filter->getBpm());
            infoText->setText(juce::String(text), false);
        }
        else
        {
            infoText->setText(juce::String(audioUtils.getLogScaledRate((float)caller->getValue()), 2) + T(" Hz"), false);
        }
    }
    else
    {
        infoText->setText(juce::String(caller->getValue(), 2), false);
    }
}

void TalComponent::buttonClicked (Button* caller)
{
    TalCore* const filter = getFilter();
	if (caller == panicButton) filter->setParameterNotifyingHost(PANIC, (float)caller->getToggleState());
	if (caller == midiLearnButton) filter->setParameterNotifyingHost(MIDILEARN, (float)caller->getToggleState());
	if (caller == oscSyncButton) filter->setParameterNotifyingHost(OSCSYNC, (float)caller->getToggleState());
	if (caller == lfo1SyncButton) filter->setParameterNotifyingHost(LFO1SYNC, (float)caller->getToggleState());
	if (caller == lfo1KeyTriggerButton) filter->setParameterNotifyingHost(LFO1KEYTRIGGER, (float)caller->getToggleState());
	if (caller == lfo2SyncButton) filter->setParameterNotifyingHost(LFO2SYNC, (float)caller->getToggleState());
	if (caller == lfo2KeyTriggerButton) filter->setParameterNotifyingHost(LFO2KEYTRIGGER, (float)caller->getToggleState());
	if (caller == chorus1Button) filter->setParameterNotifyingHost(CHORUS1ENABLE, (float)caller->getToggleState());
	if (caller == chorus2Button) filter->setParameterNotifyingHost(CHORUS2ENABLE, (float)caller->getToggleState());
}

void TalComponent::comboBoxChanged (ComboBox* caller)
{
    TalCore* const filter = getFilter();
	if (caller == voicesComboBox) filter->setParameterNotifyingHost(VOICES, (float)voicesComboBox->getSelectedId());
	if (caller == portamentoModeComboBox) filter->setParameterNotifyingHost(PORTAMENTOMODE, (float)portamentoModeComboBox->getSelectedId());
	if (caller == lfo1DestinationComboBox) filter->setParameterNotifyingHost(LFO1DESTINATION, (float)lfo1DestinationComboBox->getSelectedId());
	if (caller == lfo2DestinationComboBox) filter->setParameterNotifyingHost(LFO2DESTINATION, (float)lfo2DestinationComboBox->getSelectedId());
	if (caller == freeAdDestinationComboBox) filter->setParameterNotifyingHost(FREEADDESTINATION, (float)freeAdDestinationComboBox->getSelectedId());
	if (caller == filtertypeComboBox) filter->setParameterNotifyingHost(FILTERTYPE, (float)filtertypeComboBox->getSelectedId());
}

//==============================================================================
void TalComponent::updateParametersFromFilter()
{
    TalCore* const filter = getFilter();

    // we use this lock to make sure the processBlock() method isn't writing to the
    // lastMidiMessage variable while we're trying to read it, but be extra-careful to
    // only hold the lock for a minimum amount of time..
    filter->getCallbackLock().enter();

    // take a local copy of the info we need while we've got the lock..
	float volume = filter->getParameter(VOLUME);
	float cutoff = filter->getParameter(CUTOFF);
	float resonance = filter->getParameter(RESONANCE);
	float filterContour = filter->getParameter(FILTERCONTOUR);
	float keyfollow = filter->getParameter(KEYFOLLOW);

	float filterAttack = filter->getParameter(FILTERATTACK);
	float filterDecay = filter->getParameter(FILTERDECAY);
	float filterSustain = filter->getParameter(FILTERSUSTAIN);
	float filterRelease = filter->getParameter(FILTERRELEASE);

	float ampAttack = filter->getParameter(AMPATTACK);
	float ampDecay = filter->getParameter(AMPDECAY);
	float ampSustain = filter->getParameter(AMPSUSTAIN);
	float ampRelease = filter->getParameter(AMPRELEASE);

	float osc1Volume = filter->getParameter(OSC1VOLUME);
	float osc2Volume = filter->getParameter(OSC2VOLUME);
	float osc3Volume = filter->getParameter(OSC3VOLUME);
	float osc1Waveform = filter->getParameter(OSC1WAVEFORM);
	float osc2Waveform = filter->getParameter(OSC2WAVEFORM);

	float oscMasterTune = filter->getParameter(OSCMASTERTUNE);
	float osc1Tune = filter->getParameter(OSC1TUNE);
	float osc2Tune = filter->getParameter(OSC2TUNE);
	float osc1FineTune = filter->getParameter(OSC1FINETUNE);
	float osc2FineTune = filter->getParameter(OSC2FINETUNE);
	bool oscSync = filter->getParameter(OSCSYNC) > 0.0f;

	float voices = filter->getParameter(VOICES);
	float portamento = filter->getParameter(PORTAMENTO);
	float portamentoMode = filter->getParameter(PORTAMENTOMODE);
	
	float lfo1Waveform = filter->getParameter(LFO1WAVEFORM);
	float lfo2Waveform = filter->getParameter(LFO2WAVEFORM);

	float lfo1Rate = filter->getParameter(LFO1RATE);
	float lfo2Rate = filter->getParameter(LFO2RATE);

	float lfo1Amount = filter->getParameter(LFO1AMOUNT);
	float lfo2Amount = filter->getParameter(LFO2AMOUNT);

	float lfo1Phase = filter->getParameter(LFO1PHASE);
	float lfo2Phase = filter->getParameter(LFO2PHASE);

	float lfo1Destination = filter->getParameter(LFO1DESTINATION);
	float lfo2Destination = filter->getParameter(LFO2DESTINATION);

	float osc1Pw = filter->getParameter(OSC1PW);
	float osc2Fm = filter->getParameter(OSC2FM);
	float osc1Phase = filter->getParameter(OSC1PHASE);
	float osc2Phase = filter->getParameter(OSC2PHASE);
	float transpose  = filter->getParameter(TRANSPOSE);

	float freeAdAttack  = filter->getParameter(FREEADATTACK);
	float freeAdDecay  = filter->getParameter(FREEADDECAY);
	float freeAdAmount  = filter->getParameter(FREEADAMOUNT);
	float freeAdDestination  = filter->getParameter(FREEADDESTINATION);

	float lfo1Sync  = filter->getParameter(LFO1SYNC);
	float lfo1KeyTrigger  = filter->getParameter(LFO1KEYTRIGGER);
	float lfo2Sync  = filter->getParameter(LFO2SYNC);
	float lfo2KeyTrigger  = filter->getParameter(LFO2KEYTRIGGER);

    float velocityVolume = filter->getParameter(VELOCITYVOLUME);
    float velocityContour = filter->getParameter(VELOCITYCONTOUR);
    float velocityCutoff = filter->getParameter(VELOCITYCUTOFF);
    float pitchwheelCutoff = filter->getParameter(PITCHWHEELCUTOFF);
    float pitchwheelPitch = filter->getParameter(PITCHWHEELPITCH);
    float highpass = filter->getParameter(HIGHPASS);
    float detune = filter->getParameter(DETUNE);
    float ringmodulation = filter->getParameter(RINGMODULATION);
    
    float chorus1 = filter->getParameter(CHORUS1ENABLE);
    float chorus2 = filter->getParameter(CHORUS2ENABLE);

    float reverbWet = filter->getParameter(REVERBWET);
    float reverbDecay = filter->getParameter(REVERBDECAY);
    float reverbPreDelay = filter->getParameter(REVERBPREDELAY);
    float reverbHighCut = filter->getParameter(REVERBHIGHCUT);
    float reverbLowCut = filter->getParameter(REVERBLOWCUT);

    float oscBitcrusher = filter->getParameter(OSCBITCRUSHER);
    float filtertype = filter->getParameter(FILTERTYPE);

    // ..release the lock ASAP
    filter->getCallbackLock().exit();

	volumeKnob->setValue(volume, false);
	cutoffKnob->setValue(cutoff, false);
	resonanceKnob->setValue(resonance, false);
	filterContourKnob->setValue(filterContour, false);
	keyfollowKnob->setValue(keyfollow, false); 
	filterAttackKnob->setValue(filterAttack, false);
	filterDecayKnob->setValue(filterDecay, false);
	filterSustainKnob->setValue(filterSustain, false); 
	filterReleaseKnob->setValue(filterRelease, false);

	ampAttackKnob->setValue(ampAttack, false);
	ampDecayKnob->setValue(ampDecay, false); 
	ampSustainKnob->setValue(ampSustain, false); 
	ampReleaseKnob->setValue(ampRelease, false);

	osc1VolumeKnob->setValue(osc1Volume, false); 
	osc2VolumeKnob->setValue(osc2Volume, false); 
	osc3VolumeKnob->setValue(osc3Volume, false);
	portamentoKnob->setValue(portamento, false); 
    ringmodulationKnob->setValue(ringmodulation, false);

	oscMasterTuneKnob->setValue(oscMasterTune, false);
	osc1TuneKnob->setValue(osc1Tune, false);
	osc2TuneKnob->setValue(osc2Tune, false);
	osc1FineTuneKnob->setValue(osc1FineTune, false);
	osc2FineTuneKnob->setValue(osc2FineTune, false);

	osc1WaveformKnob->setValue(osc1Waveform, false); 
	osc2WaveformKnob->setValue(osc2Waveform, false); 

	lfo1WaveformKnob->setValue(lfo1Waveform, false);
	lfo2WaveformKnob->setValue(lfo2Waveform, false);

	lfo1RateKnob->setValue(lfo1Rate, false);
	lfo2RateKnob->setValue(lfo2Rate, false);
	lfo1AmountKnob->setValue(lfo1Amount, false);
	lfo2AmountKnob->setValue(lfo2Amount, false);

	lfo1PhaseKnob->setValue(lfo1Phase, false);
	lfo2PhaseKnob->setValue(lfo2Phase, false);

	osc1PwKnob->setValue(osc1Pw, false);
	osc2FmKnob->setValue(osc2Fm, false);
	osc1PhaseKnob->setValue(osc1Phase, false);
	osc2PhaseKnob->setValue(osc2Phase, false);
	transposeKnob->setValue(transpose, false);

	freeAdAttackKnob->setValue(freeAdAttack, false);
	freeAdDecayKnob->setValue(freeAdDecay, false);
	freeAdAmountKnob->setValue(freeAdAmount, false);

    velocityVolumeKnob->setValue(velocityVolume, false);
    velocityContourKnob->setValue(velocityContour, false);
    velocityCutoffKnob->setValue(velocityCutoff, false);
    pitchwheelCutoffKnob->setValue(pitchwheelCutoff, false);
    pitchwheelPitchKnob->setValue(pitchwheelPitch, false);
    highpassKnob->setValue(highpass, false);
    detuneKnob->setValue(detune, false);

    reverbWetKnob->setValue(reverbWet, false);
    reverbDecayKnob->setValue(reverbDecay, false);
    reverbPreDelayKnob->setValue(reverbPreDelay, false);
    reverbHighCutKnob->setValue(reverbHighCut, false);
    reverbLowCutKnob->setValue(reverbLowCut, false);

    oscBitcrusherKnob->setValue(oscBitcrusher, false);

	// Buttons
	oscSyncButton->setToggleState(oscSync, false);
	lfo1SyncButton->setToggleState(lfo1Sync > 0, false);
	lfo1KeyTriggerButton->setToggleState(lfo1KeyTrigger > 0, false);
	lfo2SyncButton->setToggleState(lfo2Sync > 0, false);
	lfo2KeyTriggerButton->setToggleState(lfo2KeyTrigger > 0, false);
    chorus1Button->setToggleState(chorus1 > 0, false);
    chorus2Button->setToggleState(chorus2 > 0, false);

	// ComboBox
	voicesComboBox->setSelectedId((int)voices, true); 
	portamentoModeComboBox->setSelectedId((int)portamentoMode, true); 
	lfo1DestinationComboBox->setSelectedId((int)lfo1Destination, true); 
	lfo2DestinationComboBox->setSelectedId((int)lfo2Destination, true); 
	freeAdDestinationComboBox->setSelectedId((int)freeAdDestination, true); 
	filtertypeComboBox->setSelectedId((int)filtertype, true);
}

